import axios from 'axios';

/**
 * @external {axios.requestConfig} https://github.com/mzabriskie/axios#request-config
 */

/**
 * @access protected
 * @desc Base Chatwork class only constructor
 */
export default class baseChatwork {
  /**
   * @desc Create Chatwork instance
   * @param {string} apikey - Chatwork API Token
   * @see http://developer.chatwork.com/ja/endpoints.html
   */
  constructor(apikey) {
    /**
     * @desc Set config defaults when create the axios instance
     * @see https://github.com/mzabriskie/axios#instance-methods
     *
     * @type {Object}
     * @property {function(url: string, config: axios.requestConfig)} instance.get
     * @property {function(url: string, config: axios.requestConfig)} instance.post
     * @property {function(url: string, config: axios.requestConfig)} instance.put
     * @property {function(url: string, config: axios.requestConfig)} instance.delete
     */
    this.instance = axios.create({
      baseURL: 'https://api.chatwork.com/v2/',
      timeout: 2500,
      headers: {
        'X-ChatWorkToken': apikey,
      },
      validateStatus: status => status >= 200 && status < 300,
      responseType: 'json',
    });
  }
}

import _ from 'lodash';
import chatworkRo from './chatworkRo';

/**
 * @access public
 * @desc For use Chatwork services
 * @see http://developer.chatwork.com/ja/endpoints.html
 */
export default class chatwork extends chatworkRo {
  /**
   * @return {Promise} Return response or error message.
   * @desc 自分に対するコンタクト承認依頼を承認する
   * @param {number} requestId - リクエストID
   * @see http://developer.chatwork.com/ja/endpoint_incoming_requests.html#PUT-incoming_requests-request_id
   */
  approveIncomingRequest(requestId) {
    return this.instance.put(`/incoming_requests/${requestId}`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分に対するコンタクト承認依頼をキャンセルする
   * @param {number} requestId - リクエストID
   * @see http://developer.chatwork.com/ja/endpoint_incoming_requests.html#DELETE-incoming_requests-request_id
   */
  rejectIncomingRequest(requestId) {
    return this.instance.delete(`/incoming_requests/${requestId}`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc グループチャットを新規作成
   * @param {Object} options - オプション引数
   * @param {string} options.description - チャット概要
   * @param {number[]} options.membersAdminIds - 管理者権限のユーザー
   * @param {number[]} options.membersMemberIds - メンバー権限のユーザー
   * @param {number[]} options.membersReadonlyIds - 閲覧のみ権限のユーザー
   * @param {string} options.iconPreset - アイコン種類
   * @param {string} options.name - グループチャット名
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#POST-rooms
   */
  createChatroom(options) {
    return this.instance.post('/rooms', {
      description: options.description,
      members_admin_ids: _.join(options.membersAdminIds),
      members_member_ids: _.join(options.membersMemberIds),
      members_readonly_ids: _.join(options.membersReadonlyIds),
      icon_preset: options.iconPreset,
      name: options.name,
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットの名前、アイコンをアップデート
   * @param {number} roomId - チャットルームID
   * @param {Object} options - オプション引数
   * @param {string} options.description - グループチャットの概要説明テキスト
   * @param {string} options.iconPreset - グループチャットのアイコン種類
   * @param {string} options.name - グループチャットのチャット名
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#PUT-rooms-room_id
   */
  updateChatroom(roomId, options) {
    return this.instance.put(`/rooms/${roomId}`, {
      description: options.description,
      icon_preset: options.iconPreset,
      name: options.name,
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc グループチャットを退席する
   * @param {number} roomId - チャットルームID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#DELETE-rooms-room_id
   */
  leaveChatroom(roomId) {
    return this.instance.delete(`/rooms/${roomId}`, {
      data: {
        action_type: 'leave',
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc グループチャットを削除する
   * @param {number} roomId - チャットルームID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#DELETE-rooms-room_id
   */
  deleteChatroom(roomId) {
    return this.instance.delete(`/rooms/${roomId}`, {
      data: {
        action_type: 'delete',
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットのメンバーを一括変更
   * @param {number} roomId - チャットルームID
   * @param {Object} options - オプション引数
   * @param {number[]} options.membersAdminIds - 管理者権限のユーザー
   * @param {number[]} options.membersMemberIds - メンバー権限のユーザー
   * @param {number[]} options.membersReadonlyIds - 閲覧のみ権限のユーザー
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#PUT-rooms-room_id-members
   */
  modifyChatroomMembers(roomId, options) {
    return this.instance.put(`/rooms/${roomId}/members`, {
      members_admin_ids: _.join(options.membersAdminIds),
      members_member_ids: _.join(options.membersMemberIds),
      members_readonly_ids: _.join(options.membersReadonlyIds),
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットに新しいメッセージを追加
   * @param {number} roomId - チャットルームID
   * @param {string} message - メッセージ本文
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#POST-rooms-room_id-messages
   */
  createMessageChatroom(roomId, message) {
    return this.instance.post(`/rooms/${roomId}/messages`, {
      body: message,
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットに新しいタスクを追加
   * @param {number} roomId - チャットルームID
   * @param {Object} options - オプション引数
   * @param {string} options.body - タスクの内容
   * @param {number} options.limit - タスクの期限(Unix timeで入力してください)
   * @param {number[]} options.toIds - 担当者のアカウントID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#POST-rooms-room_id-messages
   */
  createTaskChatroom(roomId, options) {
    return this.instance.post(`/rooms/${roomId}/tasks`, {
      body: options.body,
      limit: options.limit,
      to_ids: _.join(options.toIds),
    });
  }
}

import baseChatwork from './baseChatwork';

/**
 * @access public
 * @desc For use Chatwork Readonly services
 * @see http://developer.chatwork.com/ja/endpoints.html
 */
export default class chatworkRo extends baseChatwork {
  /**
   * @return {Promise} Return response or error message.
   * @desc 自分自身の情報を取得
   * @example
   * const cw = new Chatwork(apiKey);
   * cw.me()
   *   .then(res => {
   *     console.log(res.data);
   *     console.log(res.status);
   *     console.log(res.statusText);
   *     console.log(res.headers);
   *     console.log(res.config);
   *   })
   *   .catch(err => {
   *     if(err.response) {
   *       console.log(err.response.data);
   *       console.log(err.response.status);
   *       console.log(err.response.headers);
   *     } else if(err.request) {
   *       console.log(err.request);
   *     } else {
   *       console.log('Error', err.message);
   *     }
   *     console.log(err.config);
   *   });
   * @see http://developer.chatwork.com/ja/endpoint_me.html#GET-me
   */
  me() {
    return this.instance.get('/me');
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分の未読数、未読To数、未完了タスク数を返す
   * @see http://developer.chatwork.com/ja/endpoint_my.html#GET-my-status
   */
  getMyStatus() {
    return this.instance.get('/my/status');
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分のタスク一覧を取得する。(100件まで取得可能)
   * @param {number} assignedByAccountId - タスクの依頼者のアカウントID
   * @param {string} [status = 'open'] - タスクのステータス 'open' or 'done'
   * @see http://developer.chatwork.com/ja/endpoint_my.html#GET-my-tasks
   */
  listMyTasks(assignedByAccountId, status = 'open') {
    return this.instance.get('/my/tasks', {
      params: {
        assigned_by_account_id: assignedByAccountId,
        status,
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分のコンタクト一覧を取得
   * @see http://developer.chatwork.com/ja/endpoint_contacts.html#GET-contacts
   */
  listMyContacts() {
    return this.instance.get('/contacts');
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分に対するコンタクト承認依頼一覧を取得する(100件まで取得可能)
   * @see http://developer.chatwork.com/ja/endpoint_incoming_requests.html#GET-incoming_requests
   */
  listIncomingRequests() {
    return this.instance.get('/incoming_requests');
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc 自分のチャット一覧の取得
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms
   */
  listMyMessages() {
    return this.instance.get('/rooms');
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットの名前、アイコン、種類(my/direct/group)を取得
   * @param {number} roomId - チャットルームのID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id
   */
  getRoomInfo(roomId) {
    return this.instance.get(`/rooms/${roomId}`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットのメンバー一覧を取得
   * @param {number} roomId - チャットルームのID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-members
   */
  listRoomMembers(roomId) {
    return this.instance.get(`/rooms/${roomId}/members`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットのメッセージ一覧を取得。パラメータ未指定だと前回取得分からの差分のみを返します。(最大100件まで取得)
   * @param {number} roomId - チャットルームのID
   * @param {number} [isForce = 0] - 1を指定すると未取得にかかわらず最新の100件を取得します
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-messages
   */
  listRoomMessages(roomId, isForce = 0) {
    return this.instance.get(`/rooms/${roomId}/messages`, {
      params: {
        force: isForce,
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc メッセージ情報を取得
   * @param {number} roomId - チャットルームのID
   * @param {string} messageId - 参照するメッセージのID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-messages-message_id
   */
  getMessageInfo(roomId, messageId) {
    return this.instance.get(`/rooms/${roomId}/messages/${messageId}`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットのタスク一覧を取得 (100件まで取得可能)
   * @param {number} roomId - チャットルームのID
   * @param {number} accountId - タスクの担当者のアカウントID
   * @param {number} assignedByAccountId - タスクの依頼者のアカウントID
   * @param {string} [status = 'open'] - タスクのステータス 'open' or 'done'
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-tasks
   */
  listRoomTasks(roomId, accountId, assignedByAccountId, status = 'open') {
    return this.instance.get(`/rooms/${roomId}/tasks`, {
      params: {
        account_id: accountId,
        assigned_by_account_id: assignedByAccountId,
        status,
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc タスク情報を取得
   * @param {number} roomId - チャットルームのID
   * @param {number} taskId - 参照するタスクのID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-tasks-task_id
   */
  getTaskInfo(roomId, taskId) {
    return this.instance.get(`/rooms/${roomId}/tasks/${taskId}`);
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc チャットのファイル一覧を取得 (100件まで取得可能)
   * @param {number} roomId - チャットルームのID
   * @param {number} accountId - アップロードしたユーザーのアカウントID
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-files
   */
  listRoomFiles(roomId, accountId) {
    return this.instance.get(`/rooms/${roomId}/files`, {
      params: {
        account_id: accountId,
      },
    });
  }

  /**
   * @return {Promise} Return response or error message.
   * @desc ファイル情報を取得
   * @param {number} roomId - チャットルームのID
   * @param {number} fileId - 参照するファイルのID
   * @param {number} [isUrl = 0] - 1のときダウンロードする為のURLを生成する
   * @see http://developer.chatwork.com/ja/endpoint_rooms.html#GET-rooms-room_id-files-file_id
   */
  getFileInfo(roomId, fileId, isUrl = 0) {
    return this.instance.get(`/rooms/${roomId}/files/${fileId}`, {
      params: {
        create_download_url: isUrl,
      },
    });
  }
}

